import React from 'react';
import Navigation from './components/Navigation';
import logo from './components/icons/logobk.png';

const App = () => {
  return (
    <>
      <div>
        <Navigation />
      </div>
      <img src={logo} alt="Logo" />
    </>
  );
};

export default App;
